import React from 'react';
import ProfileData from '../data/schoolProfiles.json';

function SchoolProfile({match}) {
  console.log(match.params.name);
  return (
    <div class='card mb-3'>
      {ProfileData.map((school)=>{
        if (school.name === match.params.name){
          return <>
            <div>
              <img src={school.schoolLogoUrl} class="card-img-top mx-auto" alt="..." style={{width: 150 + 'px', height: 150 + 'px'}}></img>
              <div class="card-body">
                <h1 class="card-title">{school.name}</h1>
                <p class="card-text">{school.address}</p>
                <div class="card" style={{width: 45 + 'vw'}}>
                  <img src="..." class="card-img-top" alt="..."></img>
                  <div class="card-body">
                    <h5 class="card-title">Card title</h5>
                    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    <a href="#" class="btn btn-primary">Go somewhere</a>
                  </div>
                </div>
              </div>
            </div>
          </>
        }
      })}
      {ProfileData.map((school)=>{
        if (school.name === match.params.name){
          let keys = Object.keys(school);
          console.log(keys);
        }})}
    </div>
  );
};

export default SchoolProfile;
